function word_sound() {

    do {

        key = Number( String( Math.random() ).slice(2, 7) );
    
    } while (key < min || key > max)

    let audio = document.getElementsByTagName('audio');

    document.getElementById('player_1').src = 'sounds/english_words/' + array_of_words_changed[key][1].toLowerCase() + '.mp3';

    document.getElementById('player_2').src = 'sounds/delay/' + delay + '.mp3';

    let str_1 = 'sounds/russian_words/' + array_of_words_changed[key][3.1].toLowerCase() + '.mp3';

    if (3.2 in array_of_words_changed[key]) {

        str_1 = 'sounds/russian_words/' + array_of_words_changed[key][3.1].toLowerCase() + 
                             ' ' + array_of_words_changed[key][3.2].toLowerCase() + '.mp3';

    } 

    if (3.3 in array_of_words_changed[key]) {

        str_1 = 'sounds/russian_words/' + array_of_words_changed[key][3.1].toLowerCase() + 
                             ' ' + array_of_words_changed[key][3.2].toLowerCase() +
                             ' ' + array_of_words_changed[key][3.3].toLowerCase() + '.mp3';

    } 

    let str_2 = str_1.replace(' /', '');
    let str_3 = str_2.replace(' /', '');
    let str_4 = str_3.replace(' /', '');
    let str_5 = str_4.replace(' /', '');
    let str_6 = str_5.replace(' /', '');

    document.getElementById('player_3').src = str_6;

    document.getElementById('player_4').src = 'sounds/delay/' + delay + '.mp3';
    
    audio[0].play();
    
    for (let i = 0; i < audio.length; i++) {

        audio[i].addEventListener('ended', function() {

            audio[i + 1].play();

        });

    }  

}

