    for (let i = 1; i < arr_of_btn_repeat_voice.length; i++) {

        arr_of_btn_repeat_voice[i].style.display = 'none';

    }

    let arr_of_words = [0, word_1, word_2, word_3, word_4, word_5, word_6, word_7, word_8, word_9, word_10, word_11, word_12, word_13, word_14, word_15, word_16, word_17, word_18, word_19, word_20, word_21, word_22, word_23, word_24, word_25, word_26, word_27, word_28, word_29, word_30];

    for (let i = 1; i < arr_of_words.length; i++) {

        arr_of_words[i].innerHTML = '';

    }

    for (let i = 1; i < integer_arr.length; i++) {

        if (i in integer_arr) {

            arr_of_div_repeat_voice[i].style.display = 'flex';

            arr_of_btn_repeat_voice[i].style.display = 'block';

            arr_of_words[i].innerHTML = integer_arr[i][1] + ' || ' + integer_arr[i][2] + ' || ' + integer_arr[i][3.1];
    
            if (3.2 in integer_arr[i]) {
    
                arr_of_words[i].innerHTML += ' - ' + integer_arr[i][3.2];

            } 
    
            if (3.3 in integer_arr[i]) {
    
                arr_of_words[i].innerHTML += ' - ' + integer_arr[i][3.3];

            } 
    
            arr_of_words[i].innerHTML += ' || ' + integer_arr[i][4.1];
    
            if (4.2 in integer_arr[i]) {
    
                arr_of_words[i].innerHTML += ' - ' + integer_arr[i][4.2];

            } 
    
            if (4.3 in integer_arr[i]) {
    
                arr_of_words[i].innerHTML += ' - ' + integer_arr[i][4.3];

            } 

            arr_of_btn_repeat_voice[i].addEventListener('click', function() {

                document.getElementById('player_1').src = 'sounds/english_words/' + integer_arr[i][1].toLowerCase() + '.mp3';
            
                let audio = document.getElementsByTagName('audio');
            
                audio[0].play();   
            
            });
    
        } else {

            arr_of_div_repeat_voice[i].style.display = 'flex';

            arr_of_words[i].innerHTML = '------------------------------------------------------------------------------------------------------------';

        } 

    }

