btn_start.addEventListener('click', function() {

    min = Number(select_1.value);

    max = Number(select_2.value);

    if (min === '' || 
        max === '' ||
        min < 1 || 
        max > array_of_words_changed.length - 1 ||
        min > max || 
        isNaN(min) === true || 
        isNaN(max) === true) {

        select_1.value = '';
        select_2.value = '';

    } else {

        if (select_change_the_category_of_a_word_2.value == 1) {

            do {
            
                key = Number( String( Math.random() ).slice(2, 7) );
            
            } while (key < min || key > max)
    
            word_number_of_words.innerHTML = `1 / ${max - min + 1}`;
    
            start();
        
            word_section();
    
            number();
    
            voice();


        } else {

            delay = select_delay.value;

            word_sound();

            var myAudio = document.getElementById('player_4');

            myAudio.addEventListener('ended', function() {

                word_sound();

            });

        }

    }
    
});

