btn_the_next_word.addEventListener('click', function() {
 
    length += 1;
        
// первое слово не попадает в длинну массива Object.keys(obj).length;

    if (length <= max - min + 1) {

        do {
            
            key = Number( String( Math.random() ).slice(2, 7) );
            
        } while (key in obj || key < min || key > max)

        word_number_of_words.innerHTML = length + ` / ${max - min + 1}`;

        word_section_the_same_words.style.display = 'none';
        word_section_2.style.display = 'block';
    
        word_section();

        number();

        voice();

    } else {

        voice_switch.style.display = 'none';

        word_section_the_same_words.style.display = 'none';
        word_section_2.style.display = 'block';

        word_main.innerHTML = "Слова закончились";
        word_main.style.marginTop = '180px';

        word_number_of_words.style.display = 'none';
        word_translation_1.style.display = 'none';
        word_translation_2.style.display = 'none';
        word_translation_3.style.display = 'none';
        word_transcription.style.display = 'none';
        word_part_of_speech.style.display = 'none';

        btn_number_of_words_1.style.display = 'none';
        btn_number_of_words_2.style.display = 'none';

        btn_section.style.display = 'none';

        btn_reload.style.display = 'block';
      
    }

});

//============================================================================================================================

btn_the_next_word_new_words.addEventListener('click', function() {
      
    if (length < array_of_words_changed.length - 1) {

        length += 1;

        do {
          
            key = Number( String( Math.random() ).slice(2, 5));
          
        } while (key in obj || key < 1 || key > array_of_words_changed.length - 1) 

        word_number_of_words.innerHTML = length + ` / ${array_of_words_changed.length - 1}`;

    } else {

        length = 1;

        lastKey = key;

        obj = {};

        do {
            
            key = Number( String( Math.random() ).slice(2, 5));
          
        } while (lastKey == key || key < 1 || key > array_of_words_changed.length - 1);

        word_number_of_words.innerHTML = 1 + ` / ${array_of_words_changed.length - 1}`;

    }

    word_section_the_same_words.style.display = 'none';
    word_section_2.style.display = 'block';

    select_change_the_category_of_a_word.style.display = 'block';
    btn_change_the_category_of_a_word.style.display = 'block';

    word_section();

    number();

    voice();

});

